import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AdminDashboard = () => {
    const [students, setStudents] = useState([]);
    const [formData, setFormData] = useState({ name: '', email: '', course: '' });
    const [editingId, setEditingId] = useState(null);

    const fetchStudents = async () => {
        try {
            const token = localStorage.getItem('token');
            const res = await axios.get('http://localhost:5000/api/students', {
                headers: { 'x-auth-token': token },
            });
            setStudents(res.data);
        } catch (err) {
            console.error(err.response.data.msg);
        }
    };

    useEffect(() => {
        fetchStudents();
    }, []);

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleAddStudent = async (e) => {
        e.preventDefault();
        try {
            const token = localStorage.getItem('token');
            await axios.post('http://localhost:5000/api/students', formData, {
                headers: { 'x-auth-token': token },
            });
            setFormData({ name: '', email: '', course: '' });
            fetchStudents();
        } catch (err) {
            console.error(err.response.data.msg);
        }
    };

    const handleDelete = async (id) => {
        try {
            const token = localStorage.getItem('token');
            await axios.delete(`http://localhost:5000/api/students/${id}`, {
                headers: { 'x-auth-token': token },
            });
            fetchStudents();
        } catch (err) {
            console.error(err.response.data.msg);
        }
    };

    const handleEditClick = (student) => {
        setEditingId(student._id);
        setFormData({ name: student.name, email: student.email, course: student.course });
    };

    const handleUpdate = async () => {
        try {
            const token = localStorage.getItem('token');
            await axios.put(`http://localhost:5000/api/students/${editingId}`, formData, {
                headers: { 'x-auth-token': token },
            });
            setEditingId(null);
            setFormData({ name: '', email: '', course: '' });
            fetchStudents();
        } catch (err) {
            console.error(err.response.data.msg);
        }
    };

    return (
        <div>
            <h2>Admin Dashboard</h2>
            <h3>Add New Student</h3>
            <form onSubmit={handleAddStudent}>
                <input type="text" name="name" value={formData.name} onChange={handleChange} placeholder="Name" required />
                <input type="email" name="email" value={formData.email} onChange={handleChange} placeholder="Email" required />
                <input type="text" name="course" value={formData.course} onChange={handleChange} placeholder="Course" required />
                <button type="submit">Add Student</button>
            </form>
            <h3>All Students</h3>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Email</th>
                        <th>Course</th>
                        <th>Enrollment Date</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {students.map((student) => (
                        <tr key={student._id}>
                            <td>{editingId === student._id ? <input type="text" name="name" value={formData.name} onChange={handleChange} /> : student.name}</td>
                            <td>{editingId === student._id ? <input type="email" name="email" value={formData.email} onChange={handleChange} /> : student.email}</td>
                            <td>{editingId === student._id ? <input type="text" name="course" value={formData.course} onChange={handleChange} /> : student.course}</td>
                            <td>{new Date(student.enrollmentDate).toLocaleDateString()}</td>
                            <td>
                                {editingId === student._id ? (
                                    <button onClick={handleUpdate}>Save</button>
                                ) : (
                                    <>
                                        <button onClick={() => handleEditClick(student)}>Edit</button>
                                        <button onClick={() => handleDelete(student._id)}>Delete</button>
                                    </>
                                )}
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default AdminDashboard;
